import React from "react";

const Categories = () => {
  return (
    <div>
      <h2>Categories:</h2>
      <div class="categories--card">Burgers</div>
      <div class="categories--card">Pizza</div>
      <div class="categories--card">Pasta</div>
      <div class="categories--card">Sushi</div>
      <div class="categories--card">Salats</div>
    </div>
  );
};

export default Categories;
